  false,\n\t\"url\": null,\n\t\"notes\": \"Geologic map of the Freeland and northern
  part of the Hansville 7.5-minute quadrangles, Island County, Washington Geologic
  Map GM-64.The map area is covered by 800 to 2500 ft (Jones, 1999; Mosher and others,
  2000 Johnson and others, 2001) of glacial and nonglacial sediment above Miocene
  (Johnson and others, 1996) bedrock. Double Bluff Drift is the oldest sediment exposed
  in the map area. Booth and others (2004, fig. 2) correlate the drift to marine oxygen
  isotope stage (hereinafter stage) 6, about 185 to 125 ka. (Marinenoxygen-isotope
  stage numbers and corresponding ages used in this report are as defined in Morrison,
  1991.) Berger and Easterbrook (1993), Blunt and others (1987), and Easterbrook (1994a,b)
  report older ages for some exposures. We mapped Double Bluff Drift at the type section
  only (bluff section A; columnar section 6). The oldest named nonglacial unit in
  the map area is the Whidbey Formation, which we show only at and near the type section
  (bluff section A; columnar section 6). The Whidbey Formation correlates to the interglacial
  stage 5, about 125 to 80 ka (Blunt and others, 1987; Easterbrook, 1994a; Dragovich
  and others, 2005; Polenz and others, 2005). New luminescence dates of greater than
  150 ka were acquired on nonglacial sediments during this study (Table 1, locs. 1b,
  2b; unit Qc). If accurate, these dates imply that sediments older than stage 5 may
  be more widespread than previously recognized.\",\n\t\"license_title\": null,\n\t\"extras\":
